async function getAccounts() {
  try {
    let acc = await window.ethereum.request({
      method: "eth_requestAccounts",
    });
    return acc;
  } catch (e) {
    return [];
  }
}

async function connectMetamask() {
  if (window.ethereum) {
    const networkId = Number(window.ethereum.chainId);

    if (networkId !== 4) {
      alert('Please make sure you are connected to Ethereum network.');
      return;
    }

    try {
      const result = await this.getAccounts();
      if (Array.isArray(result) && result.length > 0) {
        let acc = result[
          0
        ];

        if(flag !== 0) {
          setMintType();
        }

        document.getElementById("connectToMetamask").innerHTML = '<span>Connected</span>';
        return acc;
      } else {
        document.getElementById("connectToMetamask").innerHTML = '<span>Connect Wallet</span>';
        return false;
      }
    } catch (err) {
      document.getElementById("connectToMetamask").innerHTML = '<span>Connect Wallet</span>';
      return false;
    }
  } else {
    document.getElementById("connectToMetamask").innerHTML = '<span>Connect Wallet</span>';
    return false;
  }
}

