function getMerkleTree(type = "normal") {

  const leaves = (type === "normal") ? whitelistedUsers : vipWhiteListedUsers;

  return new MerkleTree(leaves, keccak256,
    {
      hashLeaves: true, sortPairs: true
    });
}

async function claimSAC() {
  const account = await getCurrentAccount();

  const tree = getMerkleTree();

  const proof = tree.getHexProof(keccak256(account));

  await window.contract.methods.claimSAC(proof).send({
    from: account
  });
}

async function whitelistedMints() {
  const account = await getCurrentAccount();

  const tree = getMerkleTree();

  const proof = tree.getHexProof(keccak256(account));

  totalToMint = document.getElementById("number").innerHTML.trim();
  price = totalToMint * 0.08;
  fprice = price.toPrecision(4);

  const whitelistedMints = await window.contract.methods.whitelistedMints(totalToMint, proof).send({
    from: account,
    value: web3.utils.toWei(fprice,
      "ether")
  });

  updateStatus(`whitelistedMints: ${whitelistedMints}`);
}

